from Tree import TreeNode#Given root, node1, node2#Return node1 and node2's lowest Common Ancestordef lowestCommonAncestor(root, node1, node2):    LCA = root    if node1.val > root.val and node2.val > root.val:        LCA = lowestCommonAncestor(root.right, node1, node2)    if node1.val < root.val and node2.val < root.val:        LCA = lowestCommonAncestor(root.left, node1, node2)    return LCAnode5 = TreeNode(5)node2 = TreeNode(2)node8 = TreeNode(8)node9 = TreeNode(9)node1 = TreeNode(1)node4 = TreeNode(4)node3 = TreeNode(3)node5.left = node2node5.right = node8node8.right = node9node2.left = node1node2.right = node4node4.left = node3print(node5.levelOrderTraverse())print(lowestCommonAncestor(node5, node1, node3).val)